import image1 from "../assets/t-image1.png";
import image2 from "../assets/t-image2.jpg";
import image3 from "../assets/kelly.jpg";

export const testimonialsData = [
  {
    image: image1,
    review:
      "Llevo mas de 5 a;os con Diego y no me arrepiento de nada, ahora somos amigos! :)",
    name: "STEVE YU ",
    status: "USUARIO",
  },
  {
    image: image2,
    review:
      "Mejoraron mis niveles de stress de una manera increible, ya no estoy irritada todo el tiempo ",
    name: "ADRIANA MARTINEZ",
    status: "USUARIA",
  },
  {
    image: image3,
    review:
      " No tengo el cuerpo que quiero pero consegui una mejor meta, mi salud ante todo",
    name: "KELLY SHENG",
    status: "USUARIA",
  },
];
